import React, { useState } from 'react'
//import Transaction from '../components/Transaction'
import classNames from 'classnames'
import { transactions } from '../data/transactions'
function Comptabilite() {
    const thStyle = 'pl-3 whitespace-nowrap py-4'

    const [visible, setVisible] = useState(true)
    return (
        <div className="flex flex-col items-center h-full justify-center">
            <div className=" flex flex-col w-[400px] bg-[#5bb2f1] items-center justify-center rounded-xl py-2 border-[#0c0c75] border-b-[12px]">
                <div className="flex flex-row text-white font-bold justify-center ">Solde</div>
                <div className=" flex justify-center items-center text-white font-bold ">
                    <span
                        onClick={() => setVisible(!visible)}
                        className="material-icons  text-[35px] text-[#facc15] pr-4 cursor-pointer "
                    >
                        {visible ? 'visibility_off' : 'visibility'}
                    </span>
                    <span className="text-[30px] ">{visible ? ' 2 754 450' : '*** *** ***'}</span>
                    <span className="text-[20px] pl-2"> XAF</span>
                </div>
            </div>
            <div className=" mt-4 w-[400px] flex items-center justify-center text-[#0c0c75] font-bold text-[18px] border-[#0c0c75] border-b">
                <span className="material-icons">swap_vert</span>
                Historique des transactions
            </div>

            {/* <div className=" relative mt-3 flex flex-col gap-2 w-[400px] p-2 max-h-[400px] overflow-y-scroll ">
                {transactions.map((trans) => (
                    <Transaction
                        date={trans.date}
                        time={trans.time}
                        autor={trans.autor}
                        type={trans.type}
                        description={trans.description}
                        status={trans.status}
                        amount={trans.amount}
                    />
                ))}
            </div> */}
            <div className=" mt-1 mx-auto pt-2 flex h-[250px] w-[1000px] overflow-scroll">
                <table>
                    <thead>
                        <tr className="bg-blue text-white  px-2 text-left rounded-md">
                            <th className={thStyle}>Actions</th>
                            <th className={thStyle}>Formation</th>
                            <th className={thStyle}>Formés</th>
                            <th className={thStyle}>En formation</th>

                            <th className={thStyle}>Durée</th>
                            <th className={thStyle}>Cout Min</th>
                            <th className={thStyle}>Cout Max</th>
                            <th className={thStyle}>Fomateur 1</th>
                            <th className={thStyle}>Formateur 2</th>
                            <th className={thStyle}>Formateur 3</th>
                        </tr>
                    </thead>
                    <tbody>
                        {transactions.map((train) => (
                            <TransactionElement
                                name={train.name}
                                formed={train.formed}
                                forming={train.forming}
                                duration={train.duration}
                                mincost={train.mincost}
                                maxcost={train.maxcost}
                                trainer1={train.trainer1}
                                trainer2={train.trainer2}
                                trainer3={train.trainer3}
                            />
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    )
}

export default Comptabilite

function TransactionElement(props) {
    const tdStyle = 'px-2 text-sm whitespace-nowrap '
    return (
        <tr className="even:bg-vlight-blue hover:bg-light-blue py-1 border-light-grey border-b-[1px]" key={props.name}>
            <td className={classNames(tdStyle, ' ')}>
                <span
                    className="material-icons text-red nth px-2 cursor-pointer"
                    onClick={() => props.handleDelete(props.id)}
                >
                    delete_outline
                </span>
                <span className="material-icons text-green px-2 cursor-pointer">edit</span>
            </td>
            <td className={tdStyle}>{props.name}</td>
            <td className={tdStyle}>{props.formed}</td>
            <td className={tdStyle}>{props.forming}</td>
            <td className={tdStyle}>{props.duration}</td>
            <td className={tdStyle}>{props.mincost}XAF</td>
            <td className={tdStyle}>{props.maxcost}XAF</td>
            <td className={tdStyle}>{props.trainer1}</td>
            <td className={tdStyle}>{props.trainer2}</td>
            <td className={tdStyle}>{props.trainer3}</td>
        </tr>
    )
}
